import './style.css';

import useUser from '../../../hooks/useUser';

import Add from "../../../assets/plus.svg";
import Iconclients from "../../../assets/iconclients.svg";
import Iconsettings from "../../../assets/iconsettings.svg";
import Iconsearch from "../../../assets/iconsearch.svg";
import IconDebts from '../../../assets/debts-page.svg';

function MenuList() {
  const { title, setOpenModalClient } = useUser()

  return (
    <section className="HeaderClients">
      <div className="Title">
        {title !== 'Cobranças' ?
          <img
            src={Iconclients}
            alt="Icone de clientes"
            className="IconClients"
          />
          :
          <img
            src={IconDebts}
            alt="Icone de cobranças"
            className="IconDebts"
          />
        }
        <h1>{title}</h1>
      </div>
      {(title === 'Clientes' || title === 'Cobranças') &&
        <section className="FormClients">
          {title === 'Clientes' ?
            <button
              className="AddClients"
              onClick={() => setOpenModalClient(true)}
            >
              <img
                src={Add}
                alt="add"
                className="IconAdd"
              />
              <h2>Adicionar cliente</h2>
            </button> : ''}
          <div className="Settings">
            <img
              src={Iconsettings}
              alt="Iconsettings"
              className="IconSettings"
            />
          </div>
          <div className='Search'>
            <input
              className="InputSearch"
              type="text"
              placeholder="Pesquisa"
            />
            <img src={Iconsearch} alt="Iconsearch" className="IconSearch" />
          </div>
        </section>
      }
    </section>
  )
}

export default MenuList;
